allPrerendered :: Diagram B
allPrerendered =
  allSigns === allPlanets === allAspects
  where
    allSigns = hcat $ map (\g -> stroke (prerenderedSign g) # fc black # scale 0.5) [Aries .. Pisces]
    allPlanets = hcat $ map (\g -> stroke (prerenderedPlanet g) # fc red # scale 0.5) [Sun .. Chiron]
    allAspects = hcat $ map (\g -> stroke (prerenderedAspect g) # fc green # scale 0.5) [Conjunction .. Sesquisquare]

renderAll :: IO ()
renderAll = renderSVG "prerendered.svg" (mkWidth 400) allPrerendered

-- | Generate separate SVG files for each glyph, useful for creating a font file like in
-- https://glyphter.com/
renderSeparate :: IO ()
renderSeparate = do
  forM_ [Aries .. Pisces] $ \sign -> do
    renderSVG ("static/" <> show sign <> ".svg") (mkWidth 200) (stroke (prerenderedSign sign) # fc black # scale 0.5)

  forM_ [Sun .. Chiron] $ \planet -> do
    renderSVG ("static/" <> show planet <> ".svg") (mkWidth 200) (stroke (prerenderedPlanet planet) # fc black # scale 0.5)

  forM_ [Conjunction .. Sesquisquare] $ \aspect' -> do
    renderSVG ("static/" <> show aspect' <> ".svg") (mkWidth 200) (stroke (prerenderedAspect aspect') # fc black # scale 0.5)
